import {Component} from "react";
import uuid from "react-uuid";
import { Priority } from "../../../constants";
class PrioritySelector extends Component{
    render(){
    const [title, parentChangeHandler, parentValue, options] = this.props;
        return <label>{title}
                    <select onChange={{parentChangeHandler}} value={parentValue}>
                        {options.map(option=> <option key={uuid()} value={option.value} label={option.label}></option>)}
                    </select>
                </label>
    }
}

export {PrioritySelector};
